import React from 'react';
import './Group.css';

function Group(){
  return(
    <React.Fragment>
        <div className="group-container">
          <div className="group-head">
            <div className="group-left">
              <div className="group-avatar">
              </div>
            </div>
            <div className="group-right">
            </div>
          </div>
        </div>
    </React.Fragment>
  )
}

export default Group;
